// src/components/AnalysisResult.tsx

import React from 'react';
import { Box, Typography } from '@mui/material';

interface AnalysisResultProps {
    score: number;
    recommendations: string;
    filePath: string;
}

const AnalysisResult: React.FC<AnalysisResultProps> = ({ score, recommendations, filePath }) => {
    return (
        <Box sx={{ mt: 4 }}>
            <Typography variant="h6">Analysis Result</Typography>
            <Typography variant="body1">Score: {score}</Typography>
            <Typography variant="body1">Recommendations: {recommendations}</Typography>
            <Box sx={{ mt: 2 }}>
                <img src={filePath} alt="Uploaded" style={{ maxWidth: '100%', height: 'auto' }} />
            </Box>
        </Box>
    );
};

export default AnalysisResult;
